import React from 'react';
import Typewriter from 'react-typewriter-effect';

const TypingEffect = () => {
  console.log('TypingEffect ')
  return (
    <Typewriter
      options={{
        strings: ['Welcome to My Portfolio', 'I am a Web Developer'],
        autoStart: true,
        loop: true,
      }}
    />
  );
};

export default TypingEffect;
